// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmMenuRadioGroup 
} from '@vime/core';

import { define } from '../lib';


define('vm-menu-radio-group', VmMenuRadioGroup);


export interface MenuRadioGroupProps extends JSX.VmMenuRadioGroup, HTMLAttributes<HTMLVmMenuRadioGroupElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmMenuRadioGroupElement, MenuRadioGroupProps>(
  'vm-menu-radio-group',
  new Set(['value']),
);
